    false,nt"url": null,nt"notes": "This annual narrative report for Arapaho
    NWR, Bamforth NWR, Hutton Lake NWR, and Pathfinder NWR outlines Refuge accomplishments
    during the 1991 calendar year. The report begins with a summary of the year's highlights
    and weather conditions. Land acquisition is covered. The report includes a planning
    section which discusses management planning, public participation, compliance with
    environmental and cultural resource mandates, and research and investigations. Refuge
    administration is outlined; information about personnel, youth programs, manpower
    programs, volunteer programs, funding, safety, and technical assistance is given.
    Habitat management is also covered; subjects include wetlands, grazing, haying,
    fire management, and pest control. The wildlife section of the report discusses
    wildlife diversity, endangered and threatened species, waterfowl, marsh birds and
    waterbirds, shorebirds, raptors, game mammals, fisheries resources, and animal control.
    The public uses of the Refuge described in this report include interpretive programs,
    hunting, fishing, trapping, and law enforcement. The equipment and facilities section
    of the report provides information about new construction, rehabilitation, major
    maintenance, and computer systems. Cooperative programs, economic uses of the Refuge,
    and items of interest are provided at the end. Refuge brochures and field guides
    are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
